// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PaymentSplitter {
    //address payable public sender;
    address payable public recipient1;
    address payable public recipient2;

    constructor (address payable _recipient1, address payable _recipient2) payable {
        recipient1 = _recipient1;
        recipient2 = _recipient2;
    }   

    function split() external payable {
        uint256 balance = address(this).balance;
        require(balance > 0, "No balance available.");

        uint256 amount = balance / 2;
        uint256 remainder = balance % 2;

        recipient1.transfer(amount);
        recipient2.transfer(amount + remainder);
    }
}

